import React from 'react';
import Header from './Header';
import Footer from './Footer';
import NeonBg from './images/NeonBg.jpg';

function Homepage() {
  return (
    <div className="relative h-screen flex flex-col justify-between">
      <img src={NeonBg} alt="background" className="absolute inset-0 object-cover w-full h-full z-0" />
      <div className="relative z-10 flex flex-col h-full justify-between">
        <Header />
        <div className="flex flex-col justify-center items-center text-white font-serif font-extrabold flex-grow">
          <div className="text-center mb-10">
            <div className="">
            <p className="text-6xl p-5 border-purple-600 rounded-t-full rounded-b-xl border-[15px]">Welcome to my Blog Post Web</p>
            </div>
            <h1 className="text-4xl">Chhon</h1>
            <h1 className="text-7xl">KimEag</h1>
            <p className="text-3xl">OW Student</p>
          </div>
          <Footer />
        </div>
      </div>
    </div>
  );
}

export default Homepage;
